            <div class="container">
                <div class="row">
                    <div class="col-md-12">
                        <div class="copyright">
                            &copy; Copyright <strong>gmarin93-Agency</strong>. All Rights Reserved
          </div>
                        <div class="credits">
                            Designed by <a href="https://bootstrapmade.com/">@gmarin93</a>
                        </div>
                    </div>
                </div>
            </div>
        </footer>
    );
};

